const changeWine = (e) => {
  const src = e?.target?.dataset?.src;
  const buttons = [...document?.querySelectorAll(".heroCta button")];
  if (!buttons) {
    return;
  }
  buttons.map((button) => {
    button?.classList?.remove("is-active");
  });
  e?.target?.classList?.add("is-active");

  const mixedImage = document?.querySelector(".mixed-case-image");
  mixedImage.src = heroWines?.[src]?.srcHero;

  const bottleImage = document?.querySelector(".single-bottle");
  bottleImage.src = heroWines?.[src]?.srcBottle;

  const wasP = document.querySelector(".was > p:nth-child(2)");
  wasP.textContent = heroWines?.[src]?.was;

  const nowP = document.querySelector(".now > p:nth-child(2)");
  nowP.textContent = heroWines?.[src]?.now;

  const voucherP = document.querySelector(".voucher > p:nth-child(2)");
  voucherP.textContent = heroWines?.[src]?.voucher;

  const youPayh2 = document.querySelector(".youPay > h2:nth-child(2)");
  youPayh2.textContent = heroWines?.[src]?.youPay;
};

Gator(document).on("click", ".heroCta button", changeWine);

